INSERT INTO `status` VALUES (1,0,'Normal','The Hydroponic System is in ideal state, keep up the good work. Keep the nutrient tank topped up with the solution of the same strength to keep this balance but check regularly to ensure everything is still working as it should.',NULL),(2,1,'In excess of Nutrients','If the reading of EC is greater than the recommended level, dilute the solution by adding more water, agitate the nutrient solution thoroughly, and wait for the reading to stabilize, which could take a few minutes.',NULL),(3,2,'Lacking in Nutrients','If the reading of EC is below the ideal level, add nutrient concentrate until the ideal level is reached, make sure the nutrient solution is mixed, and wait a few minutes for the reading to stabilize.',NULL),(4,10,'Temperature is High','Hydroponic water chillers remove excess heat from your hydroponics system and keep things at a consistent temperature without very much work on your part.',NULL),(5,11,'High count in Nutrients and Temperature','Hydroponic water chillers remove excess heat from your hydroponics system and keep things at a consistent temperature without very much work on your part. If the reading of EC is greater than the recommended level, dilute the solution by adding more water, agitate the nutrient solution thoroughly, and wait for the reading to stabilize, which could take a few minutes.',NULL),(6,12,'Temperature is High, while Nutrients is Below Normal','Hydroponic water chillers remove excess heat from your hydroponics system and keep things at a consistent temperature without very much work on your part. If the reading of EC is below the ideal level, add nutrient concentrate until the ideal level is reached, make sure the nutrient solution is mixed, and wait a few minutes for the reading to stabilize.',NULL),(7,20,'Temperature is Low','If the water temperature in your hydroponic system is too cold, you can use a heater to raise the temperature.',NULL),(8,21,'Temperature is Low, Nutrient in in High count','If the water temperature in your hydroponic system is too cold, you can use a heater to raise the temperature. If the reading of EC is greater than the recommended level, dilute the solution by adding more water, agitate the nutrient solution thoroughly, and wait for the reading to stabilize, which could take a few minutes.',NULL),(9,22,'Low count in Nutrients and Temperature','If the water temperature in your hydroponic system is too cold, you can use a heater to raise the temperature. If the reading of EC is below the ideal level, add nutrient concentrate until the ideal level is reached, make sure the nutrient solution is mixed, and wait a few minutes for the reading to stabilize.',NULL),(10,100,'pH level is higher than normal','If the pH level of the hydroponic medium is high, you can add a small amount of vinegar to the water to lower the pH level.',NULL),(11,101,'Both Nutrients and pH level are in high levels','If the pH level of the hydroponic medium is high, you can add a small amount of vinegar to the water to lower the pH level. If the reading of EC is greater than the recommended level, dilute the solution by adding more water, agitate the nutrient solution thoroughly, and wait for the reading to stabilize, which could take a few minutes.',NULL),(12,102,'pH level is higher, while Nutrient count is Below Normal','If the pH level of the hydroponic medium is high, you can add a small amount of vinegar to the water to lower the pH level. If the reading of EC is below the ideal level, add nutrient concentrate until the ideal level is reached, make sure the nutrient solution is mixed, and wait a few minutes for the reading to stabilize.',NULL),(13,110,'Both pH level and Temperature are in High count','If the pH level of the hydroponic medium is high, you can add a small amount of vinegar to the water to lower the pH level. Hydroponic water chillers remove excess heat from your hydroponics system and keep things at a consistent temperature without very much work on your part.',NULL),(14,111,'Everything is in Abnormal values','If the pH level of the hydroponic medium is high, you can add a small amount of vinegar to the water to lower the pH level. Hydroponic water chillers remove excess heat from your hydroponics system and keep things at a consistent temperature without very much work on your part. If the reading of EC is greater than the recommended level, dilute the solution by adding more water, agitate the nutrient solution thoroughly, and wait for the reading to stabilize, which could take a few minutes.',NULL),(15,112,'Both pH level and Temperature are in High count with Lacking of Nutrients','If the pH level of the hydroponic medium is high, you can add a small amount of vinegar to the water to lower the pH level. Hydroponic water chillers remove excess heat from your hydroponics system and keep things at a consistent temperature without very much work on your part.  If the reading of EC is below the ideal level, add nutrient concentrate until the ideal level is reached, make sure the nutrient solution is mixed, and wait a few minutes for the reading to stabilize.',NULL),(16,120,'High values of pH with below normal temperature','If the pH level of the hydroponic medium is high, you can add a small amount of vinegar to the water to lower the pH level. If the water temperature in your hydroponic system is too cold, you can use a heater to raise the temperature.',NULL),(17,121,'Both Nutrients and pH level are in high levels with below normal temperature','If the pH level of the hydroponic medium is high, you can add a small amount of vinegar to the water to lower the pH level. If the water temperature in your hydroponic system is too cold, you can use a heater to raise the temperature.If the reading of EC is greater than the recommended level, dilute the solution by adding more water, agitate the nutrient solution thoroughly, and wait for the reading to stabilize, which could take a few minutes.',NULL),(18,122,'Low count in Nutrients and Temperature with high value of pH level','If the pH level of the hydroponic medium is high, you can add a small amount of vinegar to the water to lower the pH level. If the water temperature in your hydroponic system is too cold, you can use a heater to raise the temperature. If the reading of EC is below the ideal level, add nutrient concentrate until the ideal level is reached, make sure the nutrient solution is mixed, and wait a few minutes for the reading to stabilize.',NULL),(19,200,'The water is acidic than normal','If the pH is low, add potassium hydroxide, potassium carbonate or a pH up product slowly. Repeat until the pH reaches the optimum range.',NULL),(20,201,'In excess of Nutrients with acidic water','If the pH is low, add potassium hydroxide, potassium carbonate or a pH up product slowly. Repeat until the pH reaches the optimum range. If the reading of EC is greater than the recommended level, dilute the solution by adding more water, agitate the nutrient solution thoroughly, and wait for the reading to stabilize, which could take a few minutes.',NULL),(21,202,'Acidic water with Low Nutrient count','If the pH is low, add potassium hydroxide, potassium carbonate or a pH up product slowly. Repeat until the pH reaches the optimum range. If the reading of EC is below the ideal level, add nutrient concentrate until the ideal level is reached, make sure the nutrient solution is mixed, and wait a few minutes for the reading to stabilize.',NULL),(22,210,'Acidic water with High Temperature','If the pH is low, add potassium hydroxide, potassium carbonate or a pH up product slowly. Repeat until the pH reaches the optimum range.Hydroponic water chillers remove excess heat from your hydroponics system and keep things at a consistent temperature without very much work on your part.',NULL),(23,211,'High count in Nutrients and Temperature with Acidic Water','If the pH is low, add potassium hydroxide, potassium carbonate or a pH up product slowly. Repeat until the pH reaches the optimum range.Hydroponic water chillers remove excess heat from your hydroponics system and keep things at a consistent temperature without very much work on your part. If the reading of EC is greater than the recommended level, dilute the solution by adding more water, agitate the nutrient solution thoroughly, and wait for the reading to stabilize, which could take a few minutes.If the pH is low, add potassium hydroxide, potassium carbonate or a pH up product slowly. Repeat until the pH reaches the optimum range.Hydroponic water chillers remove excess heat from your hydroponics system and keep things at a consistent temperature without very much work on your part. If the reading of EC is greater than the recommended level, dilute the solution by adding more water, agitate the nutrient solution thoroughly, and wait for the reading to stabilize, which could take a few minutes.',NULL),(24,212,'Acidic water with Low Nutrient count with High Temperature','If the pH is low, add potassium hydroxide, potassium carbonate or a pH up product slowly. Repeat until the pH reaches the optimum range.Hydroponic water chillers remove excess heat from your hydroponics system and keep things at a consistent temperature without very much work on your part. If the reading of EC is below the ideal level, add nutrient concentrate until the ideal level is reached, make sure the nutrient solution is mixed, and wait a few minutes for the reading to stabilize.',NULL),(25,220,'Acidic water with Low Temperature','If the pH is low, add potassium hydroxide, potassium carbonate or a pH up product slowly. Repeat until the pH reaches the optimum range. If the water temperature in your hydroponic system is too cold, you can use a heater to raise the temperature.',NULL),(26,221,'Temperature is Low, Nutrient in in High count, Acidic Water','If the pH is low, add potassium hydroxide, potassium carbonate or a pH up product slowly. Repeat until the pH reaches the optimum range. If the water temperature in your hydroponic system is too cold, you can use a heater to raise the temperature. If the reading of EC is greater than the recommended level, dilute the solution by adding more water, agitate the nutrient solution thoroughly, and wait for the reading to stabilize, which could take a few minutes.',NULL),(27,222,'Everything is in  Deficient Values','If the pH is low, add potassium hydroxide, potassium carbonate or a pH up product slowly. Repeat until the pH reaches the optimum range. If the water temperature in your hydroponic system is too cold, you can use a heater to raise the temperature. If the reading of EC is below the ideal level, add nutrient concentrate until the ideal level is reached, make sure the nutrient solution is mixed, and wait a few minutes for the reading to stabilize.',NULL);
